    data: |
      SELECT DISTINCT - - 70 FROM tab0 (FORMAT parquet) cor0 CROSS JOIN tab0 (FORMAT parquet), tab1 (FORMAT parquet) AS cor1;
  - name: tab0
  - name: tab1

outputs:
  - name: q8755.out
    data: |
      70
